import React from "react";

const Contacts = ({ contacts, deleteContact }) => {
  return (
    <div>
      <table>
        <tr>
          <th>Name</th>
          <th>Phone number</th>
          <th></th>
        </tr>
        {contacts.map((contact) => {
          return (
            <tr key={contact.name}>
              <td>{contact.name}</td>
              <td>{contact.number}</td>
              <td>
                <button onClick={() => {if (window.confirm(`Delete ${contact.name}?`))deleteContact(contact.id)}}>
                  Delete
                </button>
              </td>
            </tr>
          );
        })}
      </table>
    </div>
  );
};

export default Contacts;
